import { BrowserRouter,Routes,Route } from "react-router-dom"

const App = () => {
  return (
    <BrowserRouter>
        <Routes>
            <Route path="/" element={<Notes />} />
        </Routes>

    </BrowserRouter>
  )
}

export default App
